现在请仅输出严格 JSON，必须完全匹配以下结构（键名、层级、字段齐全），所有数值用数字表示（保留2-3位小数），布尔用 true/false，字符串填写说明文字。不要输出任何解释文字或前后缀，也不要多余字段；若无法计算某值请给出可解析的近似值。

{
  "call": "[字符串]",
  "inputs": {
    "pressure": "[数值]",
    "volume": "[数值]",
    "temperature": "[数值]",
    "quantity": "[待填充]",
    "units": {
      "P": "[字符串]",
      "V": "[字符串]",
      "T": "[字符串]",
      "n": "[字符串]",
      "R": "[字符串]"
    }
  },
  "output": {
    "quantity": "[数值]"
  },
  "units": {
    "n": "[字符串]"
  },
  "explanation": "[字符串]"
}

{
  "call": "ideal_gas_calculation",
  "inputs": {
    "pressure": 24500,
    "volume": 0.00025,
    "temperature": 292.65,
    "quantity": null,
    "units": {
      "P": "Pa",
      "V": "m³",
      "T": "K",
      "n": "mol",
      "R": "J/(mol·K)"
    }
  },
  "output": {
    "quantity": 0.00252
  },
  "units": {
    "n": "mol"
  },
  "explanation": "使用理想气体状态方程PV = nRT计算NO的物质的量，其中P=24.5 kPa=24500 Pa，V=250.0 cm³=2.5×10⁻⁴ m³，T=19.5°C=292.65 K，R=8.314 J/(mol·K)。"
}

